import { useState } from "react";
import { useHistory } from "react-router-dom";
import styles from "../home.module.css";

function App() {
  const history = useHistory();

  const [Name, setName] = useState("");
  const [SName, setSName] = useState("");
  const [SellerId, setSellerId] = useState("");
  const [Manager, setManager] = useState("");
  const [MgrId, setMgrId] = useState("");
  const [Address, setAddress] = useState("");
  const [Brand, setBrand] = useState("");

  async function AddSeller(event) {
    event.preventDefault();

    const response = await fetch(
      "http://localhost:4000/channels/mychannel/chaincodes/smartContract",
      {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: "Bearer " + localStorage.getItem("token"),
        },
        body: JSON.stringify({
          fcn: "createSeller",
          peers: ["peer0.org1.example.com", "peer0.org2.example.com"],
          chaincodeName: "smartContract",
          channelName: "mychannel",
          args: [Name, SName, SellerId, Manager, MgrId, Address, Brand],
        }),
      }
    ).then(function (response) {
      return response.json();
    })
    .then(function (data) {
      alert("Seller added successfully");
      console.log(data);
      var token = document.getElementById("tx_id");
      token.innerHTML = data.result.tx_id;
      window.location.href = "http://localhost:3000/addseller";
    })
    .catch((error) => console.error("Error:", error));
  }

  return (
    <div>
      <div class={styles.topnav}>
        <a href="/">Home</a>
        <a href="register">Register</a>
        <a href="login">Login</a>
        <a href="addproduct">Add Product</a>
        <a class={styles.active} href="addseller">
          Add Seller
        </a>
        <a href="changeowner">Change Owner</a>
        <a href="authenticate">Authenticate</a>
        <a href="queryall">Query All Products</a>
        <a href="queryprod">Query Product</a>
        <a href="addconsumer">Add Consumer</a>
        <a href="queryownerprod">Query Product Owner</a>
        <a href="queryseller">Query Seller</a>
        <a href="queryconsumer">Query Consumer</a>
        <a href="querytransaction">Query Transaction</a>
        <a href="queryassethistory">Query Asset</a>
      </div>
      <h1>Add Seller</h1>
      <form onSubmit={AddSeller}>
        <input
          value={Name}
          onChange={(e) => setName(e.target.value)}
          type="text"
          placeholder="Seller Name"
        />
        <br />
        <input
          value={SName}
          onChange={(e) => setSName(e.target.value)}
          type="text"
          placeholder="Name of the Store"
        />
        <br />
        <input
          value={SellerId}
          onChange={(e) => setSellerId(e.target.value)}
          type="text"
          placeholder="Seller ID"
        />
        <br />
        <input
          value={Brand}
          onChange={(e) => setBrand(e.target.value)}
          type="text"
          placeholder="Brand"
        />
        <br />
        <input
          value={Manager}
          onChange={(e) => setManager(e.target.value)}
          type="text"
          placeholder="Manager"
        />
        <br />
        <input
          value={MgrId}
          onChange={(e) => setMgrId(e.target.value)}
          type="text"
          placeholder="Manager ID"
        />
        <br />
        <input
          value={Address}
          onChange={(e) => setAddress(e.target.value)}
          type="text"
          placeholder="Address"
        />
        <br />
        <input type="submit" value="Add Seller" />
      </form>
    </div>
  );
}

export default App;
